Here is the step-by-step guide to creating a React, Node, and Express.js web app for creating and displaying dummy data, as well as deploying the code:

**Step 1: Create a new React app**

Open your terminal and run the following command to create a new React app:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node and Express.js server**

In the `my-app` directory, create a new file called `server.js`. This file will contain the code for our Node and Express.js server.

Add the following code to `server.js`:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let dummyData = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
  { id: 3, name: 'Bob Smith', age: 40 }
];

app.get('/api/data', (req, res) => {
  res.json(dummyData);
});

app.post('/api/data', (req, res) => {
  const newData = req.body;
  dummyData.push(newData);
  res.json(dummyData);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001 and defines two API endpoints: one for retrieving the dummy data and one for adding new data.

**Step 3: Create a React component to display the data**

In the `my-app` directory, create a new file called `DataList.js`. This file will contain the code for our React component that displays the data.

Add the following code to `DataList.js`:
```
import React, { useState, useEffect } from 'react';

function DataList() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            {item.name} ({item.age})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DataList;
```
This code defines a React component that fetches the data from the API endpoint and displays it in a list.

**Step 4: Add the React component to the app**

In the `my-app` directory, open the `App.js` file and add the following code:
```
import React from 'react';
import DataList from './DataList';

function App() {
  return (
    <div>
      <DataList />
    </div>
  );
}

export default App;
```
This code adds the `DataList` component to the app.

**Step 5: Start the server and app**

In the `my-app` directory, run the following command to start the server:
```
node server.js
```
This will start the server on port 3001.

In a new terminal window, run the following command to start the app:
```
npm start
